import React from "react";
import thumbnail from '../Assetss/smile.png';

const Homepage = () => {
  return (
    <div>
       <div className="header">
                <img src= {thumbnail} className="thumbnail"/>
            <div>
                <p>Good Morning</p>
                <strong>Felas</strong>
            </div>
      </div>
    </div>

  );
};

export default Homepage;
